import React, { Component } from "react";
import axios from "axios";
class SaleLogForm extends Component {
  state = {
    data: {
      vehicle: "",
      stonetype: "",
      quantity: "",
      delivery_worker: "",
      diesel_stock_name: "",
      desiel_spent: "",
      sale_bill: "",
    },
    vehicles: [],
    stonetypes: [],
    delivery_workers: [],
    diesel_stock_names: [],
    sale_bills: [],
    errorMessage: "",
  };
  handleChange = (event) => {
    console.log("Called");
    this.setState({
      data: { ...this.state.data, [event.target.name]: event.target.value },
    });
    console.log(this.state);
  };
  componentWillMount = () => {
    this.getsale_bill();
    this.getStoneTypes();
    this.getVehicles();
    this.getdelivery_workers();
    this.getdiesel_stock_name();
  };
  getsale_bill = () => {
    axios
      .get("http://localhost:8000/bills/")
      .then((response) => {
        this.setState({ sale_bills: response.data });
      })
      .catch((error) => {
        console.log(error.response);
      });
  };
  getdiesel_stock_name = () => {
    axios
      .get("http://localhost:8000/diesel_stocks/")
      .then((response) => {
        this.setState({ diesel_stock_name: response.data });
      })
      .catch((error) => {
        console.log(error.response);
      });
  };

  getErrorMessageStyle = () => {
    let styleObject = { display: "none" };
    if (this.state.errorMessage != "") {
      styleObject = {
        width: "300px",
        color: "red",
        fontSize: "12px",
        lineHeight: "15px",
        border: "solid 0.5px red",
      };
    }
    return styleObject;
  };
  getVehicles = () => {
    axios
      .get("http://localhost:8000/sales/")
      .then((response) => {
        this.setState({ vehicles: response.data });
      })
      .catch((error) => {
        console.log(error.response);
      });
  };
  getStoneTypes = () => {
    axios
      .get("http://localhost:8000/stone_types/")
      .then((response) => {
        this.setState({ stonetypes: response.data });
      })
      .catch((error) => {
        console.log(error.response);
      });
  };
  getdelivery_workers = () => {
    axios
      .get("http://localhost:8000/worker/")
      .then((response) => {
        this.setState({ delivery_workers: response.data });
      })
      .catch((error) => {
        console.log(error.response);
      });
  };
  getVehiclesOption = () => {
    this.state.vehicles.map((veh) => {
      return (
        <option value={veh} key={veh}>
          {veh}
        </option>
      );
    });
  };
  getStoneTypeOptions = () => {
    this.state.stonetypes.map((stonetype) => {
      console.log(stonetype);
    });
  };
  getDelivery_worker_options = () => {
    this.state.delivery_workers.map((w) => {
      console.log(w);
    });
  };
  getsale_billoption = () => {
    this.state.sale_bills.map((sp) => {
      console.log(sp);
    });
  };
  getdiesel_stock_nameoptions = () => {
    this.state.diesel_stock_names.map((stock) => {
      console.log(stock);
    });
  };

  render() {
    return (
      <div className="form-wrapper">
        <form onSubmit={this.handleSubmit} encType="multipart/form-data">
          <span className="form-title">--Employee Details--</span>
          <br />
          <br />
          <table>
            <tbody>
              <tr>
                <td>Name:</td>
                <td>
                  <input
                    className="not-photo"
                    type="text"
                    name="name"
                    value={this.state.data.name}
                    onChange={this.handleChange}
                    required
                  />
                </td>
              </tr>
              <tr>
                <td>Gender:</td>
                <td>
                  <select
                    name="vehicle"
                    value={this.state.data.vehicle}
                    onChange={this.handleChange}
                    required
                    className="not-photo"
                  >
                    {this.getVehiclesOption()}
                  </select>
                </td>
              </tr>
            </tbody>
          </table>
          {this.getDelivery_worker_options()}
          {this.getdiesel_stock_nameoptions()}
        </form>
      </div>
    );
  }
}

export default SaleLogForm;
